
<style>
.sidebar_1{
    position:relative;
    display:block;
    float:left;
    top:0;
    margin:15px 10px 10px -10px;
    padding:0;
    width:320px;
    overflow:hidden
}
@media only screen and (max-width:979px){
    .sidebar_1{
        width:640px;
        margin:10px auto;
        float:none
    }
}
@media only screen and (max-width:639px){
    .sidebar_1{
        width:320px;
        float:none
    }
}
.thumb{
    position:relative;
    top:0;
    left:0;
    float:left;
    display:inline;
    margin:10px;
    width:300px;
    height:250px;
    -webkit-box-shadow:1px 1px 5px 0 rgba(109,109,109,.3);
    -moz-box-shadow:1px 1px 5px 0 rgba(109,109,109,.3);
    box-shadow:1px 1px 5px 0 rgba(109,109,109,.3)
}
.thumbb,a.thumbb{
    position:absolute;
    left:-1px;top:-1px;
    width:302px;
    height:252px;
    color:#000;
    background-color:#ccc
}
a.thumbb:visited{
    color:#ff8400
}
.thumbb:hover,a.thumbb:hover{
    color:#fff;
    background-color:#ff8400
}
.thumbi{
    position:absolute;
    left:1px;
    top:36px;
    width:300px;
    height:215px;
    line-height:211px;
    text-align:center;
    background-color:#f6f6f6;
    background-position:center center;
    background-repeat:no-repeat
}
.thumbi img{
    vertical-align:middle;
    border:none
}
.thumbc{
    position:absolute;
    left:1px;
    top:1px;
    width:300px;
    height:35px;
    background-color:#eaeaea
}
a.thumbb:hover .thumbc{
    background-color:#ff8400
}
.thumbc{
    font-size:18px;
    line-height:35px;
    text-align:center
}
.thumb_wrapper{
    position:relative;
    margin:10px auto;
    padding:0;
    width:100%;
    max-width:960px;
    overflow:hidden
}
.reserve_sidebar_space{
    float:none
}
@media only screen and (min-width:960px){
    .reserve_sidebar_space{
        max-width:640px;
        float:left;
        margin:10px
    }
}
@media only screen and (max-width:959px){
    .thumb_wrapper{
    max-width:640px
    }
}
</style>
